package com.xf.practice.old;

public class LeetCode0459 {
    public static boolean repeatedSubstringPattern(String s) {

        int len = s.length();
        if(len<2){
            return false;
        }
        for(int i=2;i<len+1;i++){
            if(len%i==0){
                int end=len/i;
                String sub=s.substring(0,end);
                String reg = "("+sub+")+";
                if(s.matches(reg)){
                    return true;
                } else {
                    continue;
                }
            } else {
                continue;
            }
        }

        return false;
    }
    public static void main(String[] args){
        System.out.println(repeatedSubstringPattern(""));
    }
}
